syntax = "proto3";

// Language Dependent Statements Start, below statements are applicable only for Java
option java_package = "ericsson.core.nrf.dbproxy.grpc.nfmessage.gpsiprofile";
option java_outer_classname = "GpsiProfileIndexProto";
option go_package = "com/dbproxy/nfmessage/gpsiprofile";
